import './App.css';
import UserForm from './components/UserForm'
import { Routes, Route, BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<UserForm/>} default />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
